  `linkId` int(11) NOT NULL AUTO_INCREMENT,
  `path` varchar(999) NOT NULL,
  `title` varchar(999) NOT NULL,
  `linkContent` longtext NOT NULL,
  `indexdate` date NOT NULL,
  `size` float NOT NULL,
