) ENGINE=InnoDB AUTO_INCREMENT=31 DEFAULT CHARSET=utf8mb4;

Lining Property Identification\r\nStandard Approach for Material-Property-Identification from frf\r\n\r\n- calculate eigenfrequencies (or frequency response functions) using assumed material properties - measure eigenfrequencies (frequency responses in most cases) - determine material properties achieving best match of calculated vs. measured eigenfrequencies - single material property: calculate updated properties directly from frequency shift factor - multiple material properties: solve optimization problem for material properties minimizing the frequency deviation (e.g. least-error-squares)\r\n\r\n© TRW Automotive Holdings Corp. 2009\r\n\r\n2\r\n\r\nLining Property Identification\r\n\r\nInverse Identification - Updating with measured Eigenfrequencies\r\nThe „Standard Approach“ for multiple properties: Parameter Identification using parametric optimization - NASTRAN SOL 200\r\n\r\nObjective\r\n\r\n f i FE  Min( F (cij , ρ l ) = ∑ wi  1 − f Meas   i i  \r\n\r\n2\r\n\r\nwi = weight factors, fFEi = calculated eigenfrequency, fmeasi = measured eigenfrequency\r\n\r\nConstraints:\r\n\r\nMlow ≤ M(ρl) ≤ Mupper;\r\n\r\nflow,k ≤ fk ≤ fupper,k\r\n\r\nused to estimate density ρl of lining material\r\n\r\n© TRW Automotive Holdings Corp. 2009\r\n\r\n3\r\n\r\nLining Property Identification\r\n\r\nInverse Identification - Updating with measured Eigenfrequencies\r\nThe „Alternative Approach“ for multiple properties:\r\n2 Objective Min( F ( ρ ) = (M ( ρ ) − M ) l l meas\r\n\r\nMin( F ) = Weight\r\n\r\nused to estimate density ρl of lining material or „dummy function“ if mass is correlated Constraints:\r\n\r\nfi\r\n\r\nmeas\r\n\r\n− ∆f ≤ f i (cik , ρ l ) ≤ f i\r\n\r\nFE\r\n\r\nmeas\r\n\r\n+ ∆f\r\n\r\nminimize constraint violation sensitivity ís calculated for respsonses => sensitivity for each frequency available in this formulation\r\n\r\n© TRW Automotive Holdings Corp. 2009\r\n\r\n4\r\n\r\nLining Property Identification\r\nthe error in a parameter identified from responses is inversily related to the sensitivity of the responses to the parameter => material properties can only be identified from measured eigenfrequencies if these are sensitive for the property\r\n\r\n=> „sensitivities“ to be known before optimization (e.g. SOL200)\r\n\r\nSensitivity of frequency fj to parameter Cik : normalized:\r\n\r\ndfj/dCik (dfj/fj) / (dCik/Cik)\r\n\r\n=> dfj/dCik is influenced by pad-geometry and lining-material !\r\n\r\n© TRW Automotive Holdings Corp. 2009\r\n\r\n5\r\n\r\nLining Property Identification\r\nMethods for Calculation of Lining Sensitivity dfj/dCik NASTRAN-SOL200: dfj/dCik\r\n- may be done in one analysis: DSAPRT(END=SENS) = ALL DSAPRT(START = FIRST,BY = 1,END = LAST) = ALL\r\n\r\n- writes tables of sensitivities of responses (DRESPi) for design variables (DESVARj):\r\n\r\nSolver Independent:\r\n\r\n“numerical differentiation”\r\n\r\n- needs of 1 + 5 runs: reference and 5 runs with one property modified - Templates for NASTRAN-available (see 20090822-pad-freq-sensitivity-template.ppt)\r\n\r\n© TRW Automotive Holdings Corp. 2009\r\n\r\n6\r\n\r\nLining Property Identification\r\nLining-sensitivity dfj/dCik – Procedure Verification:\r\n(example Daimler MFA 16inch front pad w lining-template)\r\n\r\n„pad-sensitivities (numerical differentiation)\r\nEigenfrequency Sensitivity\r\n0.25\r\n\r\n0.2\r\n\r\n0.15\r\n\r\n0.1\r\n\r\ndf/dc11 df/dc13 df/dc33 df/dc44 df/dc55\r\n\r\nSol 200: „normalized“(dfj/fj)/(Cik/dCik)\r\n(dfi/fi) (Cjk/dCjk)\r\n0.25\r\n\r\n0.05\r\n\r\n0.2 0 3129 4465 6595 8303 9914 10783 11410 12549 13334 0.15 -0.05 df/dC 0.1 C11 C13 C33 C44 C55\r\n\r\n0.05\r\n\r\n0 3131.6 4472.9 6605.6 8321.4 9936.4 10819 11417 12585 13372\r\n\r\n-0.05 [Hz]\r\n\r\n© TRW Automotive Holdings Corp. 2009\r\n\r\n7\r\n\r\nLining Property Identification\r\nElastic Material Law - Checks:\r\nThe work of stresses σ on the strains ε in an elastic body is a positive number !\r\n1 T ε σV ≥ 0 2\r\n\r\nσ i = Cik ε k\r\n\r\n1 1 V (ε i Cik ε k ) = Vε T Cε ≥